#include <iostream>
#include <vector>
#include <algorithm>

using namespace std;

class Solution {
public:
	int findMin(vector<int>& nums) {
		const int n = nums.size();
		if (n == 0){
			return 0;
		}
		int minv = nums[0];
		int l = 0, r = n - 1;
		while (l <= r){
			int m = (l + r) / 2;
			int mv = nums[m];
			minv = min(minv, mv);
			if (mv > nums[l]){
				if (nums[l] < nums[r]){ 
					return min(minv,nums[l]);
				} else{
					l = m + 1;
				} 
			} else if(mv < nums[l]){
				r = m - 1;
			} else{
				l++;
			}
		}
		return minv;
	}

	int findMinT(vector<int>& nums) {
		const int n = nums.size() - 1;
		if (n == -1)    return 0;
		for (int i = 0; i < n; ++i){
			if (nums[i] >  nums[i + 1])
				return nums[i + 1];
		}
		return nums[0];
	}
};

